restSimpleBinding.url:
{let $uriParts := ($base_url,"public/core/v3/export",$id )
let $expandP := if (empty($expand) ) then () else concat("expand=",encode-for-uri($expand))
let $paramList := ($expandP)
return 
string-join((string-join($uriParts,"/"),string-join($paramList, "&amp;")),"?")}

{let $uriParts := ($base_url ,"public/core/v3/users")

let $p-q := if (empty($q )) then () else concat("q=",encode-for-uri($q))
let $p-limit := if (empty($limit )) then () else concat("limit=",encode-for-uri($limit))
let $p-skip := if (empty($skip )) then () else concat("skip=",encode-for-uri($skip))

let $paramList := ($p-q,$p-limit,$p-skip)
return concat(string-join($uriParts,"/"),"?",string-join($paramList, "&amp;"))}

{let $uriParts := ($base_url ,"public/core/v3/roles")

let $p-q := if (empty($q )) then () else concat("q=",encode-for-uri($q))
let $p-expand := if (empty($expand )) then () else concat("expand=",encode-for-uri($expand))


let $paramList := ($p-q,$p-expand)
return concat(string-join($uriParts,"/"),"?",string-join($paramList, "&amp;"))}

